import axios from 'axios'


export default function Usetoken(){

    var config = {
      method: 'get',
      url: 'http://localhost:3001/foods',
      headers: { 
        'Authorization': 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjoiam9obmRvZSIsImlhdCI6MTYxMTUwODI4OH0._uceQhnDhvXHhLa5ig3nI13CyO8BVavV8twWKdzvVxw'
      }
    };

    axios(config)
    .then(function (response) {
      console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });


}
